ogle_example="The following will use Google Home as an example.";mcs_socket_google_first_step="Step 1: Add equipment";mcs_socket_google_first_step_info="Make sure there is a device in your device list that supports Google Home.";mcs_socket_google_second_step="Step 2: Modify the device name";mcs_socket_google_second_step_info="Modify your device to something that Google Home easily recognizes such as: living room light, bedroom light";mcs_socket_google_third_step="Step 3: Set up Google Home";mcs_socket_google_third_step_info="Make sure the phone system voice is English and then use the Home app to set up Google Home.";mcs_socket_google_fourth_step="Step 4: Add Home Control Action";mcs_socket_google_fourth_step_info='In the Home app, open Home Control, add the device and select "MIPC". In the new window, select the region where your app account is located, and enter your app account password. Your device will appear in the Home Control Devices list after the binding is successful.';mcs_socket_google_fifth_step="Step 5: Control the device";mcs_socket_google_fifth_step_info="Now you can control your device with Google Home.";mcs_socket_google_order="Supported voice commands include:<br>Ok Google,turn on socket.<br>Ok Google,set bedroom light to 30%.<br>Ok Google,brighten garage light.<br>Ok Google,set kitchen light to green.";mcs_socket_ready="Pripravená zásuvka";mcs_upport_up_to_64_characters="Až 64 znakov";mcs_set_wifi_equipment_remind="Aké sú požiadavky na Wi-Fi?";mcs_ap_mode="Klasický režim (AP hotspot)";mcs_search_device="Vyhľadávacie zariadenie";mcs_socket_class_style="AP";mcs_normal_new="normálne";mcs_sd_fault="Zlyhanie SD karty";mcs_no_detected_sdcard="Neidentifikovala sa žiadna SD karta";mcs_can_use="Možno použiť";mcs_no_detected_hard_disk="Nie je zistený žiadny pevný disk";mcs_hard_disk_fault="Chyba pevného disku";mcs_being_searching="Vyhľadávanie, počkajte";mcs_hard_disk_title_1="Najstarší priestor sa prepíše, keď na pevnom disku nie je použiteľný priestor";m